('11', 'X840', 'Fantastic! This keeps the professor anonymous, while still voicing his disdain.', 'Very close! While this protects Aiden from backlash, it also silences Aiden\'s disdain.', 'Incorrect. Aiden\'s friends can still notify the professor of the post.', 'Incorrect. The school administration might punish Aiden for his opinion.', 4),
