('21', '570X', 'Close. Aiden can still wish his mom a happy Mother\'s Day in a safer way, by removing her name from the image.', 'Almost. The image isn\'t entirely problematic, just the part with his mother\'s name.', 'Not quite. This could affect other people\'s privacy, as well as making it difficult even for Aiden\'s friends to determine which picture is actually his mother.', 'Stellar! This way Aiden still gets his point across without any privacy concerns. Many password reset forms ask for the mother\'s maiden name as an identity verification.', 4),
('30', '0X00', 'Not quite. The information about his grades could be a lot more damaging than the information about his team.', 'Good job! This post could look bad if a future employer ever looked up his profile.', 'Incorrect. This could look bad if a future employer ever looked up his profile. Posting his failing grades makes it even worse.', 'Incorrect. This post could look bad if a future employer ever looked up his profile.', 5),
('31', '33X3', 'Not quite. That\'s not the only problem with this post.', 'Not quite. That\'s not the only problem with this post.', 'Well done! This post can only harm Aiden later down the line.', 'Not quite. That\'s not the only problem with this post.', 5),
